 from SDK_NAME: $SDK_NAME\"\nexit 1\nfi\n\n# 3 - Determine the other platform\nif [ \"$WSDT_SDK_PLATFORM\" == \"iphoneos\" ]; then\nWSDT_OTHER_PLATFORM=iphonesimulator\nelse\nWSDT_OTHER_PLATFORM=iphoneos\nfi\n\n# 4 - Find the build directory\nif [[ \"$BUILT_PRODUCTS_DIR\" =~ (.*)$WSDT_SDK_PLATFORM$ ]]; then\nWSDT_OTHER_BUILT_PRODUCTS_DIR=\"${BASH_REMATCH[1]}${WSDT_OTHER_PLATFORM}\"\nelse\necho \"Could not find other platform build directory.\"\nexit 1\nfi\n\n# Build the other platform.\nbuild_static_library \"${WSDT_OTHER_PLATFORM}${WSDT_SDK_VERSION}\"\n\n# If we're currently building for iphonesimulator, then need to rebuild\n#   to ensure that we get both i386 and x86_64\nif [ \"$WSDT_SDK_PLATFORM\" == \"iphonesimulator\" ]; then\nbuild_static_library \"${SDK_NAME}\"\nfi\n\n# Join the 2 static libs into 1 and push into the .framework\nmake_fat_library \"${BUILT_PRODUCTS_DIR}/${WSDT_INPUT_STATIC_LIB}\" \\\n\"${WSDT_OTHER_BUILT_PRODUCTS_DIR}/${WSDT_INPUT_STATIC_LIB}\" \\\n\"${WSDT_FRAMEWORK_LOCATION}/Versions/A/${WSDT_FRAMEWORK_NAME}\"\n\n# Ensure that the framework is present in both platform's build directories\ncp -a \"${WSDT_FRAMEWORK_LOCATION}/Versions/A/${WSDT_FRAMEWORK_NAME}\" \\\n\"${WSDT_OTHER_BUILT_PRODUCTS_DIR}/${WSDT_FRAMEWORK_NAME}.framework/Versions/A/${WSDT_FRAMEWORK_NAME}\"\n\n# Copy the framework to the user's desktop\n#ditto \"${WSDT_FRAMEWORK_LOCATION}\" \"${HOME}/Desktop/${WSDT_FRAMEWORK_NAME}.framework\"\nditto \"${WSDT_FRAMEWORK_LOCATION}\" \"${SOURCE_ROOT}/${WSDT_FRAMEWORK_NAME}.framework\"";
